import React from "react";
import { BrowserRouter, Routes, Route} from "react-router-dom";
import Navigation from "./Pages";
import Footer from "./Pages";
import Home from "./Pages";
import About from "./Pages";
import Contact from "./Pages";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Navigation />
        <Switch>
          <Route
            path="/home"
            exact
            component={() => <Home />}
          />
          <Route
            path="/about"
            exact
            component={() => <About />}
          />
          <Route
            path="/contact"
            exact
            component={() => <Contact />}
          />
        </Switch>
        <Footer />
      </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
